"   <div class=\"block pha drugH1Div\" id=\"F146960\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibits bacterial cell wall synthesis by binding to one or more of the penicillin-binding proteins (PBPs) which in turn inhibits the final transpeptidation step of peptidoglycan synthesis in bacterial cell walls, thus inhibiting cell wall biosynthesis. Bacteria eventually lyse due to ongoing activity of cell wall autolytic enzymes (autolysins and murein hydrolases) while cell wall assembly is arrested.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F146979\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Rapid and well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Widely throughout the body and reaches therapeutic concentrations in most tissues and body fluids, including synovial, pericardial, pleural, and peritoneal fluids; bile, sputum, and urine; bone, myocardium, gallbladder, skin, and soft tissue",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 20%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 1-2 hours; Renal failure: 20-24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: 70-90 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (&gt;90% as unchanged drug)",
"    </p>",
"   </div>",
