"   <div class=\"block pha drugH1Div\" id=\"F2135523\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Insulin acts via specific membrane-bound receptors on target tissues to regulate metabolism of carbohydrate, protein, and fats. Target organs for insulin include the liver, skeletal muscle, and adipose tissue.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Within the liver, insulin stimulates hepatic glycogen synthesis. Insulin promotes hepatic synthesis of fatty acids, which are released into the circulation as lipoproteins. Skeletal muscle effects of insulin include increased protein synthesis and increased glycogen synthesis. Within adipose tissue, insulin stimulates the processing of circulating lipoproteins to provide free fatty acids, facilitating triglyceride synthesis and storage by adipocytes; also directly inhibits the hydrolysis of triglycerides. In addition, insulin stimulates the cellular uptake of amino acids and increases cellular permeability to several ions, including potassium, magnesium, and phosphate. By activating sodium-potassium ATPases, insulin promotes the intracellular movement of potassium.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Normally secreted by the pancreas, insulin products are manufactured for pharmacologic use through recombinant DNA technology using either",
"     <i>",
"      E. coli",
"     </i>",
"     or",
"     <i>",
"      Saccharomyces cerevisiae",
"     </i>",
"     . Insulins are categorized based on the onset, peak, and duration of effect (eg, rapid-, short-, intermediate-, and long-acting insulin). Insulin NPH, an isophane suspension of human insulin, is an intermediate-acting insulin.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F2136093\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Rate of absorption, onset, and duration of activity may be affected by site of injection, exercise, presence of lipodystrophy, local blood supply, and/or temperature.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Onset of action: 1-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Peak effect: 4-12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 14-24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Time to peak, plasma: 6-10 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine",
"    </p>",
"   </div>",
"  </div>",
